import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection'
import Cards from '../Cards';
import Footer from '../Footer';

function Home () {
    return (
        <>
            <HeroSection id="aboutme" />
            <Cards id="projects" />
            <Footer id="footer" />
        </>
    )
}

export default Home;
